import React from 'react';
import { useHistory } from 'react-router-dom';  // Correct import
import Button from '@mui/material/Button';
import MyImage from './image.jpg';
import './er.css';

const EventRequest = () => {
  const history = useHistory();

  const handleCreateRequest = () => {
    // Add any logic you need before navigating to the new page

    // Navigate to the new page with the form
    history.push('/new-form-page'); // Update 'new-form-page' with the path of your new page
  };

  return (
    <div className="evzent-request">
      <img src={MyImage} alt="My Image" className="event-request-image" />
      <div className="event-request-inner">
        <Button onClick={handleCreateRequest}>
          Create Request
        </Button>
      </div>
    </div>
  );
};

export default EventRequest;
